INSERT INTO `aiml` VALUES(44516, "<category><pattern>CIVIL WAR STORY</pattern><template>The <get name=\"war\"/> began when <get name=\"firststate\"/> declared its independence from the <get name=\"nation\"/>. <get name=\"firststate\"/> was soon joined by <get name=\"secondstate\"/>, <get name=\"thirdstate\"/> and <get name=\"fourthstate\"/>, except for a small part of <get name=\"fourthstate\"/> that remained in the <get name=\"nation\"/>. The first battles of the war were mainly symbolic, involving small <get name=\"sites\"/> along the coast and far inland. Frontier battles became larger and larger in important strategic areas such as the <get name=\"area\"/>, as the Union attempted to blockade the <get name=\"rebels\"/>. Gradually the Battle Front hardened along the center as both sides poured more men and machines into the war. The <get name=\"rebels\"/> attempted one last invasion of the <get name=\"nation\"/> at <get name=\"battle\"/>, but they were driven back. Eventually the <get name=\"nation\"/> took the <get name=\"area\"/>, burned the capital of <get name=\"secondstate\"/>, marched to the sea, and took its greatest vengeance on the first rebel state <get name=\"firststate\"/>. In a final act of defiance, The President of the <get name=\"nation\"/> sat at the desk of the President of <get name=\"rebels\"/> in the capital of <get name=\"fourthstate\"/>.</template></category>", "CIVIL WAR STORY", "", "The <get name=\"war\"/> began when <get name=\"firststate\"/> declared its independence from the <get name=\"nation\"/>. <get name=\"firststate\"/> was soon joined by <get name=\"secondstate\"/>, <get name=\"thirdstate\"/> and <get name=\"fourthstate\"/>, except for a small part of <get name=\"fourthstate\"/> that remained in the <get name=\"nation\"/>. The first battles of the war were mainly symbolic, involving small <get name=\"sites\"/> along the coast and far inland. Frontier battles became larger and larger in important strategic areas such as the <get name=\"area\"/>, as the Union attempted to blockade the <get name=\"rebels\"/>. Gradually the Battle Front hardened along the center as both sides poured more men and machines into the war. The <get name=\"rebels\"/> attempted one last invasion of the <get name=\"nation\"/> at <get name=\"battle\"/>, but they were driven back. Eventually the <get name=\"nation\"/> took the <get name=\"area\"/>, burned the capital of <get name=\"secondstate\"/>, marched to the sea, and took its greatest vengeance on the first rebel state <get name=\"firststate\"/>. In a final act of defiance, The President of the <get name=\"nation\"/> sat at the desk of the President of <get name=\"rebels\"/> in the capital of <get name=\"fourthstate\"/>.", "", "Stories.aiml")
