INSERT INTO `aiml` VALUES(44519, "<category><pattern>FAT FOUR TWO</pattern><template><think><set name=\"four\"><srai>RANDOM FOURS</srai></set><set name=\"two\"><srai>RANDOM TWOS</srai></set></think> <get name=\"four\"/> is married to <get name=\"two\"/>. At a conscious level, <get name=\"four\"/> felt that he was a bit overweight and thoght he should lose some pounds. But part of him feels that he is going to get in fights with people if he slims down again. In fact, once before when he was trimmer, he did get into a lot of political fights, as well as arguments with his wife that almost ended in divorce from <get name=\"two\"/>. Because they have a child together, <get name=\"four\"/> is very worried about divorce, custody rights and the effect of their separation on the child and himself. So part of him thinks that keeping the pounds on will help him hang on to the stability of his relationship with <get name=\"two\"/>.</template></category>", "FAT FOUR TWO", "", "<think><set name=\"four\"><srai>RANDOM FOURS</srai></set><set name=\"two\"><srai>RANDOM TWOS</srai></set></think> <get name=\"four\"/> is married to <get name=\"two\"/>. At a conscious level, <get name=\"four\"/> felt that he was a bit overweight and thoght he should lose some pounds. But part of him feels that he is going to get in fights with people if he slims down again. In fact, once before when he was trimmer, he did get into a lot of political fights, as well as arguments with his wife that almost ended in divorce from <get name=\"two\"/>. Because they have a child together, <get name=\"four\"/> is very worried about divorce, custody rights and the effect of their separation on the child and himself. So part of him thinks that keeping the pounds on will help him hang on to the stability of his relationship with <get name=\"two\"/>.", "", "Stories.aiml")
