INSERT INTO `aiml` VALUES(44525, "<category><pattern>JOURNEY</pattern><template><get name=\"four\"/> is the son of <get name=\"two\"/> and <get name=\"one\"/>. He was raised and trained by the wise <get name=\"nine\"/>. His youthful playmate <get name=\"five\"/> got in him in trouble often. But his other friend <get name=\"three\"/> was a town favorite, and kept his public image good. When he reached maturity, <get name=\"four\"/> left his home on a long journey, accompanied by <get name=\"three\"/> and <get name=\"five\"/>. They originally planned to meet <get name=\"nine\"/> in a distant land, but they could not locate him. Instead, they faced a great danger posed by the the unscrupulous demon <get name=\"seven\"/>. <get name=\"five\"/> was nearly <get name=\"kill\"/>ed, but saved by at the last minute when a loyal new friend, <get name=\"six\"/> appeared. <get name=\"six\"/> led <get name=\"three\"/>, <get name=\"four\"/> and <get name=\"five\"/> far away from <get name=\"seven\"/>. Now <get name=\"five\"/> was able to recover. <get name=\"four\"/> met and fell in love with <get name=\"2a\"/>. His father <get name=\"one\"/> reappeared along with the lost <get name=\"nine\"/>. But then <get name=\"seven\"/> discovered their hideout, and <get name=\"kill\"/>s <get name=\"five\"/>. <get name=\"nine\"/> called upon the powerful wizard <get name=\"eight\"/>. Together, <get name=\"four\"/>, his father <get name=\"one\"/>, the wise <get name=\"nine\"/>, the wizard <get name=\"eight\"/> and all his other friends defeated the resourceful <get name=\"seven\"/> in a mighty battle. After mourning the loss of his friend <get name=\"five\"/>, <get name=\"four\"/> returned to his homeland to marry <get name=\"2a\"/> in a big celebration, along with <get name=\"one\"/>, <get name=\"two\"/>, <get name=\"three\"/>, <get name=\"six\"/>, <get name=\"eight\"/>, <get name=\"nine\"/>, and all his other friends.</template></category>", "JOURNEY", "", "<get name=\"four\"/> is the son of <get name=\"two\"/> and <get name=\"one\"/>. He was raised and trained by the wise <get name=\"nine\"/>. His youthful playmate <get name=\"five\"/> got in him in trouble often. But his other friend <get name=\"three\"/> was a town favorite, and kept his public image good. When he reached maturity, <get name=\"four\"/> left his home on a long journey, accompanied by <get name=\"three\"/> and <get name=\"five\"/>. They originally planned to meet <get name=\"nine\"/> in a distant land, but they could not locate him. Instead, they faced a great danger posed by the the unscrupulous demon <get name=\"seven\"/>. <get name=\"five\"/> was nearly <get name=\"kill\"/>ed, but saved by at the last minute when a loyal new friend, <get name=\"six\"/> appeared. <get name=\"six\"/> led <get name=\"three\"/>, <get name=\"four\"/> and <get name=\"five\"/> far away from <get name=\"seven\"/>. Now <get name=\"five\"/> was able to recover. <get name=\"four\"/> met and fell in love with <get name=\"2a\"/>. His father <get name=\"one\"/> reappeared along with the lost <get name=\"nine\"/>. But then <get name=\"seven\"/> discovered their hideout, and <get name=\"kill\"/>s <get name=\"five\"/>. <get name=\"nine\"/> called upon the powerful wizard <get name=\"eight\"/>. Together, <get name=\"four\"/>, his father <get name=\"one\"/>, the wise <get name=\"nine\"/>, the wizard <get name=\"eight\"/> and all his other friends defeated the resourceful <get name=\"seven\"/> in a mighty battle. After mourning the loss of his friend <get name=\"five\"/>, <get name=\"four\"/> returned to his homeland to marry <get name=\"2a\"/> in a big celebration, along with <get name=\"one\"/>, <get name=\"two\"/>, <get name=\"three\"/>, <get name=\"six\"/>, <get name=\"eight\"/>, <get name=\"nine\"/>, and all his other friends.", "", "Stories.aiml")
