INSERT INTO `aiml` VALUES(44528, "<category><pattern>NO HELP AT ALL</pattern><template>Hello, I just started looking at getting <get name=\"product\"/>s working with ALICE (and <get name=\"PROPRIETARY\"/> in general) last week, I had the same problem for a while too. I am using the <get name=\"PROPRIETARY\"/>-<get name=\"OPEN\"/> bridge driver which comes with the <get name=\"proprietarylang\"/> <get name=\"DEVKIT\"/> (most versions I think) to link from <get name=\"proprietarylang\"/>/<get name=\"proprietarylang\"/>script using <get name=\"PROPRIETARY\"/> to an <get name=\"OPEN\"/> data source which in turn links to an Access <get name=\"product\"/>. This may not be what you need but hopefully it may give you an idea of how to get your <get name=\"QUERYLANG\"/> <get name=\"product\"/> working. The <get name=\"PROPRIETARY\"/>-<get name=\"OPEN\"/> bridge driver is located through the path \"sun.<get name=\"proprietary\"/>.<get name=\"open\"/>.<get name=\"proprietary\"/><get name=\"open\"/>Driver\". i.e. <get name=\"proprietary\"/><get name=\"open\"/>Driver is a class in the package <get name=\"open\"/>, which is a package of <get name=\"proprietary\"/>, which is a package inside sun. The <get name=\"QUERYLANG\"/> driver you specified below \"org.gjt.mm.my<get name=\"querylang\"/>.Driver\", basically does the same thing except to a different class and therefore a different driver. ALICE has this driver in a library in the lib directory (I assume) which is called my<get name=\"querylang\"/>_comp.jar. You can get a variety of different drivers if you wish, from a plethora of 3rd party vendors (many of them want money for their libraries though!). Just do a search on the web. The url part links to the data source in the case of <get name=\"OPEN\"/> <get name=\"product\"/>s. (I had to configure my <get name=\"OPEN\"/> Data source to point at my Access <get name=\"product\"/> through Data Source (<get name=\"OPEN\"/>), in the Administrative tools folder (assuming you are running W2K/XP. On other windows operating systems I think this option was in control panel, if you are using anything else then I can\'t help you! :-) ) As for My<get name=\"QUERYLANG\"/> I imagine that it must have a similar interface to link to the actual <get name=\"product\"/>. But that is a guess on my part. Maybe someone else knows more about this? There is a useful tutorial on the <get name=\"proprietarylang\"/>.sun.com website you\'re your interested. Hope that helps you out.</template></category>", "NO HELP AT ALL", "", "Hello, I just started looking at getting <get name=\"product\"/>s working with ALICE (and <get name=\"PROPRIETARY\"/> in general) last week, I had the same problem for a while too. I am using the <get name=\"PROPRIETARY\"/>-<get name=\"OPEN\"/> bridge driver which comes with the <get name=\"proprietarylang\"/> <get name=\"DEVKIT\"/> (most versions I think) to link from <get name=\"proprietarylang\"/>/<get name=\"proprietarylang\"/>script using <get name=\"PROPRIETARY\"/> to an <get name=\"OPEN\"/> data source which in turn links to an Access <get name=\"product\"/>. This may not be what you need but hopefully it may give you an idea of how to get your <get name=\"QUERYLANG\"/> <get name=\"product\"/> working. The <get name=\"PROPRIETARY\"/>-<get name=\"OPEN\"/> bridge driver is located through the path \"sun.<get name=\"proprietary\"/>.<get name=\"open\"/>.<get name=\"proprietary\"/><get name=\"open\"/>Driver\". i.e. <get name=\"proprietary\"/><get name=\"open\"/>Driver is a class in the package <get name=\"open\"/>, which is a package of <get name=\"proprietary\"/>, which is a package inside sun. The <get name=\"QUERYLANG\"/> driver you specified below \"org.gjt.mm.my<get name=\"querylang\"/>.Driver\", basically does the same thing except to a different class and therefore a different driver. ALICE has this driver in a library in the lib directory (I assume) which is called my<get name=\"querylang\"/>_comp.jar. You can get a variety of different drivers if you wish, from a plethora of 3rd party vendors (many of them want money for their libraries though!). Just do a search on the web. The url part links to the data source in the case of <get name=\"OPEN\"/> <get name=\"product\"/>s. (I had to configure my <get name=\"OPEN\"/> Data source to point at my Access <get name=\"product\"/> through Data Source (<get name=\"OPEN\"/>), in the Administrative tools folder (assuming you are running W2K/XP. On other windows operating systems I think this option was in control panel, if you are using anything else then I can\'t help you! :-) ) As for My<get name=\"QUERYLANG\"/> I imagine that it must have a similar interface to link to the actual <get name=\"product\"/>. But that is a guess on my part. Maybe someone else knows more about this? There is a useful tutorial on the <get name=\"proprietarylang\"/>.sun.com website you\'re your interested. Hope that helps you out.", "", "Stories.aiml")
