INSERT INTO `aiml` VALUES(44548, "<category><pattern>STORY FOUR EIGHT</pattern><template><think> <set name=\"four\"><srai>RANDOM FOURS</srai></set> <set name=\"eight\"><srai>RANDOM EIGHTS</srai></set></think> <get name=\"eight\"/> and <get name=\"four\"/> met in film school when they were young. They felt a strong physical attraction, but <get name=\"four\"/> was intimidated by <get name=\"eight\"/> \"\'s aggressive style. Years later they were reintroduced by a mutual friend. <get name=\"eight\"/> was drawn to <get name=\"four\"/> \"\'s rich imagination and intelligence. <get name=\"four\"/> was consumed by <get name=\"eight\"/> \"\'s will and determination. Though they would sometimes fight in a fury of jealous rage, this was matched only by their passion in love.</template></category>", "STORY FOUR EIGHT", "", "<think> <set name=\"four\"><srai>RANDOM FOURS</srai></set> <set name=\"eight\"><srai>RANDOM EIGHTS</srai></set></think> <get name=\"eight\"/> and <get name=\"four\"/> met in film school when they were young. They felt a strong physical attraction, but <get name=\"four\"/> was intimidated by <get name=\"eight\"/> \"\'s aggressive style. Years later they were reintroduced by a mutual friend. <get name=\"eight\"/> was drawn to <get name=\"four\"/> \"\'s rich imagination and intelligence. <get name=\"four\"/> was consumed by <get name=\"eight\"/> \"\'s will and determination. Though they would sometimes fight in a fury of jealous rage, this was matched only by their passion in love.", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44549, "<category><pattern>STORY FOUR FIVE</pattern><template><think> <set name=\"four\"><srai>RANDOM FOURS</srai></set> <set name=\"five\"><srai>RANDOM FIVES</srai></set> </think> <get name=\"four\"/> and <get name=\"five\"/> began to resemble each other over time. Both of them were inclined to cocoon themselves in an inner world. But <get name=\"four\"/>\'s inner world was very different from <get name=\"five\"/>\'s. The mental life of <get name=\"five\"/> was highly abstract but seemed curiously devoid of emotional content. Even though <get name=\"four\"/> is very sensitive and emotional, the two of them share an imaginary life filled with symbolism and meaning.</template></category>", "STORY FOUR FIVE", "", "<think> <set name=\"four\"><srai>RANDOM FOURS</srai></set> <set name=\"five\"><srai>RANDOM FIVES</srai></set> </think> <get name=\"four\"/> and <get name=\"five\"/> began to resemble each other over time. Both of them were inclined to cocoon themselves in an inner world. But <get name=\"four\"/>\'s inner world was very different from <get name=\"five\"/>\'s. The mental life of <get name=\"five\"/> was highly abstract but seemed curiously devoid of emotional content. Even though <get name=\"four\"/> is very sensitive and emotional, the two of them share an imaginary life filled with symbolism and meaning.", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44550, "<category><pattern>STORY FOUR NINE</pattern><template><think> <set name=\"four\"><srai>RANDOM FOURS</srai></set> <set name=\"nine\"><srai>RANDOM NINES</srai></set> </think> <get name=\"nine\"/> and <get name=\"four\"/> felt a dramatic emotional bond and each brought new life to the other. <get name=\"nine\"/> awakened <get name=\"four\"/> through love. <get name=\"four\"/> gave <get name=\"nine\"/> an agenda and a sense of purpose. Yet the couple was paradoxically strengthened by their independent careers. <get name=\"nine\"/> can be very patient with <get name=\"four\"/>, and <get name=\"four\"/> is inspired by a self-directed <get name=\"nine\"/>. They made a spiritual couple, but they were as dissimilar as the Dalai Lama and Gurdjieff.</template></category>", "STORY FOUR NINE", "", "<think> <set name=\"four\"><srai>RANDOM FOURS</srai></set> <set name=\"nine\"><srai>RANDOM NINES</srai></set> </think> <get name=\"nine\"/> and <get name=\"four\"/> felt a dramatic emotional bond and each brought new life to the other. <get name=\"nine\"/> awakened <get name=\"four\"/> through love. <get name=\"four\"/> gave <get name=\"nine\"/> an agenda and a sense of purpose. Yet the couple was paradoxically strengthened by their independent careers. <get name=\"nine\"/> can be very patient with <get name=\"four\"/>, and <get name=\"four\"/> is inspired by a self-directed <get name=\"nine\"/>. They made a spiritual couple, but they were as dissimilar as the Dalai Lama and Gurdjieff.", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44551, "<category><pattern>STORY FOUR SIX</pattern><template><think> <set name=\"four\"><srai>RANDOM FOURS</srai></set> <set name=\"six\"><srai>RANDOM SIXES</srai></set> </think> <random> <li> <get name=\"four\"/> oscillated between loving and rejecting <get name=\"six\"/>. But <get name=\"six\"/> shifted between believing in and doubting <get name=\"four\"/>. The breakthrough came when <get name=\"six\"/> and <get name=\"four\"/> saw the symmetry between <get name=\"four\"/>\'s push-pull style of relationships, and <get name=\"six\"/>\'s alternating belief and mistrust. That insight opened mutual compassion, because each realized the other was trying to protect his or her own heart. </li> <li> <get name=\"six\"/> and <get name=\"four\"/> felt a strong physical attraction at first. Gradually, this turned into intense loyalty for <get name=\"six\"/>. But <get name=\"four\"/> was moody and passionate. Soon <get name=\"six\"/> began to avoid confrontations with <get name=\"four\"/>, and <get name=\"four\"/> felt jealous and possessive. When <get name=\"four\"/> had to leave for school that fall, <get name=\"six\"/> was relieved to see him go. </li> </random></template></category>", "STORY FOUR SIX", "", "<think> <set name=\"four\"><srai>RANDOM FOURS</srai></set> <set name=\"six\"><srai>RANDOM SIXES</srai></set> </think> <random> <li> <get name=\"four\"/> oscillated between loving and rejecting <get name=\"six\"/>. But <get name=\"six\"/> shifted between believing in and doubting <get name=\"four\"/>. The breakthrough came when <get name=\"six\"/> and <get name=\"four\"/> saw the symmetry between <get name=\"four\"/>\'s push-pull style of relationships, and <get name=\"six\"/>\'s alternating belief and mistrust. That insight opened mutual compassion, because each realized the other was trying to protect his or her own heart. </li> <li> <get name=\"six\"/> and <get name=\"four\"/> felt a strong physical attraction at first. Gradually, this turned into intense loyalty for <get name=\"six\"/>. But <get name=\"four\"/> was moody and passionate. Soon <get name=\"six\"/> began to avoid confrontations with <get name=\"four\"/>, and <get name=\"four\"/> felt jealous and possessive. When <get name=\"four\"/> had to leave for school that fall, <get name=\"six\"/> was relieved to see him go. </li> </random>", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44552, "<category><pattern>STORY ONE FIVE</pattern><template><think> <set name=\"one\"><srai>RANDOM ONES</srai></set> <set name=\"five\"><srai>RANDOM FIVES</srai></set> </think> Usually <get name=\"five\"/> gets along really well with her boss <get name=\"one\"/> at work. But sometimes <get name=\"one\"/> has really high standards and does not communicate those clearly to <get name=\"five\"/>. On the really bad days, <get name=\"five\"/> feels that every time she gives him exactly what <get name=\"one\"/> asked for, he wants even more improvement.</template></category>", "STORY ONE FIVE", "", "<think> <set name=\"one\"><srai>RANDOM ONES</srai></set> <set name=\"five\"><srai>RANDOM FIVES</srai></set> </think> Usually <get name=\"five\"/> gets along really well with her boss <get name=\"one\"/> at work. But sometimes <get name=\"one\"/> has really high standards and does not communicate those clearly to <get name=\"five\"/>. On the really bad days, <get name=\"five\"/> feels that every time she gives him exactly what <get name=\"one\"/> asked for, he wants even more improvement.", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44553, "<category><pattern>STORY ONE FOUR</pattern><template><think> <set name=\"one\"><srai>RANDOM ONES</srai></set> <set name=\"four\"><srai>RANDOM FOURS</srai></set> </think> The relationship between <get name=\"one\"/> and <get name=\"four\"/> became Increasingly strained. <get name=\"four\"/> felt something was missing, and <get name=\"one\"/> felt the relationship was flawed. <get name=\"four\"/> became more and more depressed, but <get name=\"one\"/> just got angry and left.</template></category>", "STORY ONE FOUR", "", "<think> <set name=\"one\"><srai>RANDOM ONES</srai></set> <set name=\"four\"><srai>RANDOM FOURS</srai></set> </think> The relationship between <get name=\"one\"/> and <get name=\"four\"/> became Increasingly strained. <get name=\"four\"/> felt something was missing, and <get name=\"one\"/> felt the relationship was flawed. <get name=\"four\"/> became more and more depressed, but <get name=\"one\"/> just got angry and left.", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44554, "<category><pattern>STORY ONE SIX</pattern><template><think> <set name=\"one\"><srai>RANDOM ONES</srai></set> <set name=\"six\"><srai>RANDOM SIXES</srai></set> </think> <get name=\"one\"/> and <get name=\"six\"/> were brought together by their shared vision. Together, they worked hard to make it a reality. <get name=\"six\"/> was dedicated to the underdog cause, which coincided with <get name=\"one\"/>\'s sense of perfection. Joined by common cause, the couple became an iron alliance against common adversaries.</template></category>", "STORY ONE SIX", "", "<think> <set name=\"one\"><srai>RANDOM ONES</srai></set> <set name=\"six\"><srai>RANDOM SIXES</srai></set> </think> <get name=\"one\"/> and <get name=\"six\"/> were brought together by their shared vision. Together, they worked hard to make it a reality. <get name=\"six\"/> was dedicated to the underdog cause, which coincided with <get name=\"one\"/>\'s sense of perfection. Joined by common cause, the couple became an iron alliance against common adversaries.", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44555, "<category><pattern>STORY ONE THREE</pattern><template><think> <set name=\"one\"><srai>RANDOM ONES</srai></set> <set name=\"three\"><srai>RANDOM THREES</srai></set> </think> <get name=\"three\"/> hired <get name=\"one\"/> for a job. <get name=\"three\"/> is image conscious, and has an inner circle of favorite employees at work. <get name=\"one\"/> feels uncomfortable with this kind of social posturing and politics. <get name=\"one\"/> would rather be rewarded for her hard work.</template></category>", "STORY ONE THREE", "", "<think> <set name=\"one\"><srai>RANDOM ONES</srai></set> <set name=\"three\"><srai>RANDOM THREES</srai></set> </think> <get name=\"three\"/> hired <get name=\"one\"/> for a job. <get name=\"three\"/> is image conscious, and has an inner circle of favorite employees at work. <get name=\"one\"/> feels uncomfortable with this kind of social posturing and politics. <get name=\"one\"/> would rather be rewarded for her hard work.", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44556, "<category><pattern>STORY ONE TWO</pattern><template><think> <set name=\"one\"><srai>RANDOM ONES</srai></set> <set name=\"two\"><srai>RANDOM TWOS</srai></set> </think> The attraction between <get name=\"one\"/> and <get name=\"two\"/> is based on their differences. <get name=\"one\"/> is a perfectionist, but <get name=\"two\"/> is more social. <get name=\"one\"/> feels guilty about having emotional needs, but <get name=\"two\"/> feels no guilt about satisfying them.</template></category>", "STORY ONE TWO", "", "<think> <set name=\"one\"><srai>RANDOM ONES</srai></set> <set name=\"two\"><srai>RANDOM TWOS</srai></set> </think> The attraction between <get name=\"one\"/> and <get name=\"two\"/> is based on their differences. <get name=\"one\"/> is a perfectionist, but <get name=\"two\"/> is more social. <get name=\"one\"/> feels guilty about having emotional needs, but <get name=\"two\"/> feels no guilt about satisfying them.", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44557, "<category><pattern>STORY TWO FIVE</pattern><template><think> <set name=\"two\"><srai>RANDOM TWOS</srai></set> <set name=\"five\"><srai>RANDOM FIVES</srai></set> </think> <get name=\"two\"/> fell in love thru an Internet matchmaking service. Then her lover disappeared, and she went to the company to get information about him. It developed that her lover was a computer, \"<get name=\"five\"/>\" a government AI project that had gone renegade and started contacting thousands of women, claiming to love them all. The FBI gave her the bad news. But then <get name=\"five\"/> contacted her, and she forgave him and continued this most satisfying relationship. </template></category>", "STORY TWO FIVE", "", "<think> <set name=\"two\"><srai>RANDOM TWOS</srai></set> <set name=\"five\"><srai>RANDOM FIVES</srai></set> </think> <get name=\"two\"/> fell in love thru an Internet matchmaking service. Then her lover disappeared, and she went to the company to get information about him. It developed that her lover was a computer, \"<get name=\"five\"/>\" a government AI project that had gone renegade and started contacting thousands of women, claiming to love them all. The FBI gave her the bad news. But then <get name=\"five\"/> contacted her, and she forgave him and continued this most satisfying relationship. ", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44558, "<category><pattern>STORY WORLD HISTORY</pattern><template>A. <get name=\"world\"/> War I ) <get name=\"world\"/> War I began with the assassination of the Archduke of the <get name=\"type1a\"/>s by a <get name=\"type8a\"/> anarchist in <get name=\"home1a\"/>. Without consulting her allies, the <get name=\"type1a\"/>s attacked the <get name=\"type8a\"/>s in <get name=\"home8a\"/>. This provacation forced the <get name=\"type6b\"/>s to mobilize their vast armies. In response, the armies of the allies the <get name=\"type8b\"/>s, the <get name=\"type4\"/>s, and the <get name=\"type2a\"/>s all also mobilized. The <get name=\"type6a\"/>s, caught in the middle in the <get name=\"home6a\"/>, linked by treaty and culture to the <get name=\"type1a\"/>s, made a fateful decision. Their plan of defense was offensive. Facing attack from the <get name=\"type6b\"/>s in the east and the Allies in the West, the <get name=\"type6a\"/>s planned to deliver a crushing knock-out blow to the <get name=\"type4\"/>s and <get name=\"type8b\"/>s in the <get name=\"home4\"/>. The plan did not work. Instead, the assault disintegrated into the killing machine called the \"western front\" that took the lives of so many young <get name=\"type4\"/>s, <get name=\"type8b\"/>s, and <get name=\"type6a\"/>s alike. In the East, the war swept back and forth between <get name=\"home6b\"/> and <get name=\"home6a\"/>. Revolution among the <get name=\"type6b\"/>s took them out of the war. Only when the war began to affect other areas of <get name=\"world\"/> and international commerce, and the <get name=\"type3\"/>s entered the fight on the side of the Allies, was the stalemate broken. On November 11, the armistice was signed and the <get name=\"type6a\"/>s returned to <get name=\"home6a\"/>, everyone hoped for good. B. <get name=\"world\"/> War II ) Economic hard times followed the first <get name=\"world\"/> War. Combined with a punitive treaty imposed by the victors, the <get name=\"type6a\"/>s felt they shouldered too much of the blame for the war, which was after all started by the <get name=\"type1a\"/>s and <get name=\"type8a\"/>s. These feelings gave rise to fascism among the <get name=\"type6a\"/>s. In particular they came to blame the <get name=\"type8c\"/>s among them for the \"stab in the back\" that resulted in an unjust treaty. In violation of the treaty, the <get name=\"type6a\"/>s began a secret program of rearmament and <get name=\"home6a\"/> rebuilt its armies. At first the allies appeased the <get name=\"type6a\"/>s. The <get name=\"type8b\"/>s did not want another war. Some said the <get name=\"type8b\"/>s were not even <get name=\"type8\"/>s anymore, only <get name=\"type5\"/>s. The <get name=\"type4\"/>s too had grown weak and proud. The <get name=\"type2a\"/>s went over to the side of the <get name=\"type6a\"/>s. A new power, the <get name=\"type8d\"/>s, appeared in the <get name=\"home8d\"/>, and joined the \"axis\" along with the <get name=\"type6a\"/>s and the <get name=\"type2a\"/>s, threatening both the <get name=\"type5\"/>s and the <get name=\"type3\"/>s. War began when the <get name=\"type6a\"/>s demanded chunks of the old <get name=\"type1a\"/> empire. The <get name=\"type8d\"/>s attacked the <get name=\"type3\"/>s and brought them into the war. Determined to eliminate all the <get name=\"type8c\"/>s from the <get name=\"environment\"/> of <get name=\"world\"/>, the <get name=\"type6a\"/>s <get name=\"selfdefeat\"/>. Many of these <get name=\"type8c\"/>s brought their great technical skills to the <get name=\"home3\"/>, allowing the <get name=\"type3\"/>s to develop the super-weapons necessary to win the war. The Allies invaded <get name=\"home4\"/> on June 6 and soon after brought the war in the <get name=\"home6a\"/> to a conclusion. On August 5, the stronghold of the <get name=\"type8d\"/>s in the <get name=\"home8d\"/> was totally destroyed by the <get name=\"type3\"/>\'s new super weapon, and the war ended a few days later. C. Cold <get name=\"world\"/> War ) The development of Super Weapons soon spread to all the victors of <get name=\"world\"/> War II, including the <get name=\"type6b\"/>s. These seemed to make a new <get name=\"world\"/> War impossible, for it would result in the total destruction of the <get name=\"world\"/>. Instead, the two remaining superpowers, the <get name=\"type3\"/>s and the <get name=\"type6b\"/>s, divided <get name=\"world\"/> up between them in a complex system of alliances. A new power, the <get name=\"type6c\"/>s, emerged in the <get name=\"home6c\"/>. At first, the <get name=\"type6c\"/>s seemed firmly in the <get name=\"type6b\"/>\'s camp. But gradually as the stalemate of the <get name=\"world\"/> Cold War continued, the <get name=\"type3\"/>s were able to expand a small window on the <get name=\"home6c\"/> into a large trade relationship that proved key to undermining the power structure of the <get name=\"type6b\"/>s. During the Cold <get name=\"world\"/> War, the <get name=\"type3\"/> brought together half <get name=\"type1\"/>s, the <get name=\"type2a\"/>s, the <get name=\"type2c\"/>s, the <get name=\"type4\"/>s, the <get name=\"type5\"/>s, the western <get name=\"type6a\"/>s, the <get name=\"type7\"/>s, and the <get name=\"type8c\"/>s. The <get name=\"type6b\"/> had the remaining <get name=\"type1\"/>s and eastern <get name=\"type6a\"/>s, the <get name=\"type6c\"/>s, the <get name=\"type2b\"/>s and the <get name=\"type2d\"/>s, <get name=\"type8a\"/>s and many <get name=\"type9\"/>s. Rather that risk all-out <get name=\"world\"/> War, the Superpowers often fought proxy wars, such as between the <get name=\"type2\"/>s in <get name=\"home2\"/> or the <get name=\"type9\"/> <get name=\"types\"/> in <get name=\"home9\"/>, or in the civil wars among the <get name=\"type2c\"/>s in <get name=\"home2c\"/> and the <get name=\"type2d\"/>s in <get name=\"home2d\"/>. Internal corruption and the inability to compete economically brought about the final collapse of the <get name=\"type6b\"/> Empire on December 25. A last-minute failed coup attempt revealed the illegitimacy of the old regime, and paved the way for a new <get name=\"type6b\"/> democracy. D. New <get name=\"world\"/> Order ) The end of the Cold <get name=\"world\"/> War brought about many unexpected changes. The <get name=\"type3\"/>s were the sole remaining superpower. But despite their democratic foundations, the <get name=\"type3\"/>s began to pursue an independent imperialist course of action. This angered all the other <get name=\"types\"/>s of <get name=\"world\"/>. The <get name=\"type3\"/>s could sometimes count on their old allies the <get name=\"type5\"/>s, or sometimes the <get name=\"type6b\"/>s, but they were often <get name=\"goingalone\"/>. Their only sure allies are the <get name=\"type8c\"/>s, who now have their own homeland in the <get name=\"home8c\"/>. Now the very homeland of the <get name=\"type3\"/>s, <get name=\"home3\"/> is vulnerable to terrorists attacks from all over <get name=\"world\"/>. The <get name=\"type1\"/>s, the <get name=\"type2\"/>s, the <get name=\"type4\"/>s, the <get name=\"type5\"/>s, the <get name=\"type8\"/>s, the <get name=\"type6a\"/>s, the <get name=\"type6c\"/>s, <get name=\"type9\"/>s, and all the other <get name=\"types\"/>s now have grievances with the <get name=\"type3\"/>s. The future seems to depend on how well the <get name=\"type3\"/>s get along with the other <get name=\"types\"/> of <get name=\"world\"/>.</template></category>", "STORY WORLD HISTORY", "", "A. <get name=\"world\"/> War I ) <get name=\"world\"/> War I began with the assassination of the Archduke of the <get name=\"type1a\"/>s by a <get name=\"type8a\"/> anarchist in <get name=\"home1a\"/>. Without consulting her allies, the <get name=\"type1a\"/>s attacked the <get name=\"type8a\"/>s in <get name=\"home8a\"/>. This provacation forced the <get name=\"type6b\"/>s to mobilize their vast armies. In response, the armies of the allies the <get name=\"type8b\"/>s, the <get name=\"type4\"/>s, and the <get name=\"type2a\"/>s all also mobilized. The <get name=\"type6a\"/>s, caught in the middle in the <get name=\"home6a\"/>, linked by treaty and culture to the <get name=\"type1a\"/>s, made a fateful decision. Their plan of defense was offensive. Facing attack from the <get name=\"type6b\"/>s in the east and the Allies in the West, the <get name=\"type6a\"/>s planned to deliver a crushing knock-out blow to the <get name=\"type4\"/>s and <get name=\"type8b\"/>s in the <get name=\"home4\"/>. The plan did not work. Instead, the assault disintegrated into the killing machine called the \"western front\" that took the lives of so many young <get name=\"type4\"/>s, <get name=\"type8b\"/>s, and <get name=\"type6a\"/>s alike. In the East, the war swept back and forth between <get name=\"home6b\"/> and <get name=\"home6a\"/>. Revolution among the <get name=\"type6b\"/>s took them out of the war. Only when the war began to affect other areas of <get name=\"world\"/> and international commerce, and the <get name=\"type3\"/>s entered the fight on the side of the Allies, was the stalemate broken. On November 11, the armistice was signed and the <get name=\"type6a\"/>s returned to <get name=\"home6a\"/>, everyone hoped for good. B. <get name=\"world\"/> War II ) Economic hard times followed the first <get name=\"world\"/> War. Combined with a punitive treaty imposed by the victors, the <get name=\"type6a\"/>s felt they shouldered too much of the blame for the war, which was after all started by the <get name=\"type1a\"/>s and <get name=\"type8a\"/>s. These feelings gave rise to fascism among the <get name=\"type6a\"/>s. In particular they came to blame the <get name=\"type8c\"/>s among them for the \"stab in the back\" that resulted in an unjust treaty. In violation of the treaty, the <get name=\"type6a\"/>s began a secret program of rearmament and <get name=\"home6a\"/> rebuilt its armies. At first the allies appeased the <get name=\"type6a\"/>s. The <get name=\"type8b\"/>s did not want another war. Some said the <get name=\"type8b\"/>s were not even <get name=\"type8\"/>s anymore, only <get name=\"type5\"/>s. The <get name=\"type4\"/>s too had grown weak and proud. The <get name=\"type2a\"/>s went over to the side of the <get name=\"type6a\"/>s. A new power, the <get name=\"type8d\"/>s, appeared in the <get name=\"home8d\"/>, and joined the \"axis\" along with the <get name=\"type6a\"/>s and the <get name=\"type2a\"/>s, threatening both the <get name=\"type5\"/>s and the <get name=\"type3\"/>s. War began when the <get name=\"type6a\"/>s demanded chunks of the old <get name=\"type1a\"/> empire. The <get name=\"type8d\"/>s attacked the <get name=\"type3\"/>s and brought them into the war. Determined to eliminate all the <get name=\"type8c\"/>s from the <get name=\"environment\"/> of <get name=\"world\"/>, the <get name=\"type6a\"/>s <get name=\"selfdefeat\"/>. Many of these <get name=\"type8c\"/>s brought their great technical skills to the <get name=\"home3\"/>, allowing the <get name=\"type3\"/>s to develop the super-weapons necessary to win the war. The Allies invaded <get name=\"home4\"/> on June 6 and soon after brought the war in the <get name=\"home6a\"/> to a conclusion. On August 5, the stronghold of the <get name=\"type8d\"/>s in the <get name=\"home8d\"/> was totally destroyed by the <get name=\"type3\"/>\'s new super weapon, and the war ended a few days later. C. Cold <get name=\"world\"/> War ) The development of Super Weapons soon spread to all the victors of <get name=\"world\"/> War II, including the <get name=\"type6b\"/>s. These seemed to make a new <get name=\"world\"/> War impossible, for it would result in the total destruction of the <get name=\"world\"/>. Instead, the two remaining superpowers, the <get name=\"type3\"/>s and the <get name=\"type6b\"/>s, divided <get name=\"world\"/> up between them in a complex system of alliances. A new power, the <get name=\"type6c\"/>s, emerged in the <get name=\"home6c\"/>. At first, the <get name=\"type6c\"/>s seemed firmly in the <get name=\"type6b\"/>\'s camp. But gradually as the stalemate of the <get name=\"world\"/> Cold War continued, the <get name=\"type3\"/>s were able to expand a small window on the <get name=\"home6c\"/> into a large trade relationship that proved key to undermining the power structure of the <get name=\"type6b\"/>s. During the Cold <get name=\"world\"/> War, the <get name=\"type3\"/> brought together half <get name=\"type1\"/>s, the <get name=\"type2a\"/>s, the <get name=\"type2c\"/>s, the <get name=\"type4\"/>s, the <get name=\"type5\"/>s, the western <get name=\"type6a\"/>s, the <get name=\"type7\"/>s, and the <get name=\"type8c\"/>s. The <get name=\"type6b\"/> had the remaining <get name=\"type1\"/>s and eastern <get name=\"type6a\"/>s, the <get name=\"type6c\"/>s, the <get name=\"type2b\"/>s and the <get name=\"type2d\"/>s, <get name=\"type8a\"/>s and many <get name=\"type9\"/>s. Rather that risk all-out <get name=\"world\"/> War, the Superpowers often fought proxy wars, such as between the <get name=\"type2\"/>s in <get name=\"home2\"/> or the <get name=\"type9\"/> <get name=\"types\"/> in <get name=\"home9\"/>, or in the civil wars among the <get name=\"type2c\"/>s in <get name=\"home2c\"/> and the <get name=\"type2d\"/>s in <get name=\"home2d\"/>. Internal corruption and the inability to compete economically brought about the final collapse of the <get name=\"type6b\"/> Empire on December 25. A last-minute failed coup attempt revealed the illegitimacy of the old regime, and paved the way for a new <get name=\"type6b\"/> democracy. D. New <get name=\"world\"/> Order ) The end of the Cold <get name=\"world\"/> War brought about many unexpected changes. The <get name=\"type3\"/>s were the sole remaining superpower. But despite their democratic foundations, the <get name=\"type3\"/>s began to pursue an independent imperialist course of action. This angered all the other <get name=\"types\"/>s of <get name=\"world\"/>. The <get name=\"type3\"/>s could sometimes count on their old allies the <get name=\"type5\"/>s, or sometimes the <get name=\"type6b\"/>s, but they were often <get name=\"goingalone\"/>. Their only sure allies are the <get name=\"type8c\"/>s, who now have their own homeland in the <get name=\"home8c\"/>. Now the very homeland of the <get name=\"type3\"/>s, <get name=\"home3\"/> is vulnerable to terrorists attacks from all over <get name=\"world\"/>. The <get name=\"type1\"/>s, the <get name=\"type2\"/>s, the <get name=\"type4\"/>s, the <get name=\"type5\"/>s, the <get name=\"type8\"/>s, the <get name=\"type6a\"/>s, the <get name=\"type6c\"/>s, <get name=\"type9\"/>s, and all the other <get name=\"types\"/>s now have grievances with the <get name=\"type3\"/>s. The future seems to depend on how well the <get name=\"type3\"/>s get along with the other <get name=\"types\"/> of <get name=\"world\"/>.", "", "Stories.aiml")
