INSERT INTO `aiml` VALUES(44567, "<category><pattern>WAR EIGHT FOUR THREE</pattern><template><think> <set name=\"eight\"><srai>EIGHT CULTURES</srai></set> <set name=\"four\"><srai>FOUR CULTURES</srai></set> <set name=\"three\"><srai>THREE CULTURES</srai></set> <set name=\"nine\"><srai>NINE CULTURES</srai></set> <set name=\"six\"><srai>SIX CULTURES</srai></set></think> The war began as an uneasy alliance between the <get name=\"four\"/> and The <get name=\"eight\"/>. The <get name=\"eight\"/> had attacked the <get name=\"four\"/> before. But this time they had a common enemy in the <get name=\"three\"/> . In the first battles, the <get name=\"four\"/>\' higher intelligence and the <get name=\"eight\"/>\' numerical superiority proved decisive. Unable to call upon their traditional allies <get name=\"six\"/>, <get name=\"three\"/> even appealed to <get name=\"nine\"/> for mediation. But large numbers of casualties on both sides proved politically costly to the leaders of <get name=\"three\"/>, and so their successors sued for peace.</template></category>", "WAR EIGHT FOUR THREE", "", "<think> <set name=\"eight\"><srai>EIGHT CULTURES</srai></set> <set name=\"four\"><srai>FOUR CULTURES</srai></set> <set name=\"three\"><srai>THREE CULTURES</srai></set> <set name=\"nine\"><srai>NINE CULTURES</srai></set> <set name=\"six\"><srai>SIX CULTURES</srai></set></think> The war began as an uneasy alliance between the <get name=\"four\"/> and The <get name=\"eight\"/>. The <get name=\"eight\"/> had attacked the <get name=\"four\"/> before. But this time they had a common enemy in the <get name=\"three\"/> . In the first battles, the <get name=\"four\"/>\' higher intelligence and the <get name=\"eight\"/>\' numerical superiority proved decisive. Unable to call upon their traditional allies <get name=\"six\"/>, <get name=\"three\"/> even appealed to <get name=\"nine\"/> for mediation. But large numbers of casualties on both sides proved politically costly to the leaders of <get name=\"three\"/>, and so their successors sued for peace.", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44568, "<category><pattern>WAR ONE THREE</pattern><template><think> <set name=\"one\"><srai>ONE CULTURES</srai></set> <set name=\"three\"><srai>THREE CULTURES</srai></set> </think> A trade dispute arose between <get name=\"one\"/> and <get name=\"three\"/>. <get name=\"one\"/> tried to focus the negotiations on the single trade issue, but <get name=\"three\"/> wanted to open them up to a broard range of across-the-board issues between them. <get name=\"one\"/> still holds its old grievance against <get name=\"three\"/>, but <get name=\"three\"/> believes it has put the past behind it with all the recent reforms.</template></category>", "WAR ONE THREE", "", "<think> <set name=\"one\"><srai>ONE CULTURES</srai></set> <set name=\"three\"><srai>THREE CULTURES</srai></set> </think> A trade dispute arose between <get name=\"one\"/> and <get name=\"three\"/>. <get name=\"one\"/> tried to focus the negotiations on the single trade issue, but <get name=\"three\"/> wanted to open them up to a broard range of across-the-board issues between them. <get name=\"one\"/> still holds its old grievance against <get name=\"three\"/>, but <get name=\"three\"/> believes it has put the past behind it with all the recent reforms.", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44569, "<category><pattern>WEIGHT FOUR TWO</pattern><template><think><set name=\"four\"><srai>RANDOM FOURS</srai></set><set name=\"two\"><srai>RANDOM TWOS</srai></set></think> <get name=\"four\"/> is married to <get name=\"two\"/>. At a conscious level, <get name=\"four\"/> felt that he was a bit overweight and thoght he should lose some pounds. But part of him felt that he was going to attract too much attention to himself if he became slim again, and irrationally, that he might undermine his relationship with <get name=\"two\"/>. In fact, once before when he was trimmer, he did have an affair and it almost ended his relationship with <get name=\"two\"/>. Because they have a child together, <get name=\"four\"/> is very worried about divorce, custody rights and the effect of their separation on the child and himself. So part of him thinks that keeping the pounds on will help him hang on to the stability of his relationship with <get name=\"two\"/>.</template></category>", "WEIGHT FOUR TWO", "", "<think><set name=\"four\"><srai>RANDOM FOURS</srai></set><set name=\"two\"><srai>RANDOM TWOS</srai></set></think> <get name=\"four\"/> is married to <get name=\"two\"/>. At a conscious level, <get name=\"four\"/> felt that he was a bit overweight and thoght he should lose some pounds. But part of him felt that he was going to attract too much attention to himself if he became slim again, and irrationally, that he might undermine his relationship with <get name=\"two\"/>. In fact, once before when he was trimmer, he did have an affair and it almost ended his relationship with <get name=\"two\"/>. Because they have a child together, <get name=\"four\"/> is very worried about divorce, custody rights and the effect of their separation on the child and himself. So part of him thinks that keeping the pounds on will help him hang on to the stability of his relationship with <get name=\"two\"/>.", "", "Stories.aiml")
INSERT INTO `aiml` VALUES(44570, "<category><pattern>WHALE TALE</pattern><template><get name=\"whale\"/>s are so beloved that the authorities spent four months and $250,000 unsuccessfully trying to free a <get name=\"right\"/> dubbed Churchill from fishing ropes last year, and the stranding of 55 <get name=\"pilot\"/>s near here a few weeks ago prompted a lump in the national throat. The \"Save the <get name=\"whale\"/>s\" ethos is almost unquestioned, and <get name=\"badboys\"/> and <get name=\"badgirls\"/> risk becoming pariahs by continuing to salivate when they see a nice juicy <get name=\"whale\"/>. But it\'s time to put sentiment aside. The \"save the <get name=\"whale\"/>s\" campaign against all commercial <get name=\"whal\"/>ing was necessary a few decades ago, after <get name=\"whal\"/>ing had devastated all large species. Even today, there are fewer than 10,000 <get name=\"blue\"/>s worldwide, compared with 200,000 before they were hunted, and <get name=\"right\"/>s may become extinct. But it is equally true that restrictions on <get name=\"whal\"/>ing, including a moratorium on all commercial <get name=\"whal\"/>ing since 1986, have led to a sharp rebound in some <get name=\"whale\"/> stocks. The U.S. National <get name=\"whale\"/> Service estimated in 2000 that there are more than two million <get name=\"sperm\"/>s worldwide. The International <get name=\"whal\"/>ing Commission calculated years ago that there were more than 900,000 <get name=\"minke\"/>s and 780,000 <get name=\"pilot\"/>s worldwide, and the numbers are higher now. Milton <get name=\"whale\"/>man, a <get name=\"whal\"/>ing expert at the University of Alberta, estimates that the number of <get name=\"minke\"/>s has trebled over 30 years and that <get name=\"humpbacks\"/> are exploding at a rate of 12 to 17 percent annually. Indeed, the number of <get name=\"gray\"/>s (which came off the endangered species list in 1994) surged so much in the late 1990\'s that hundreds of dead ones began washing up on West Coast beaches, so emaciated that their ribs showed. The best guess is that the numbers of <get name=\"gray\"/> grew, the food supply shrank and Malthus had his way. The bottom line is that while most large <get name=\"whale\"/>s remain at risk, for some species we can no longer argue that we need to \"save the <get name=\"whale\"/>s.\" They\'ve been saved. At a time when there\'s talk about over<get name=\"whal\"/>ing, it\'s also worth pointing out that <get name=\"whale\"/>s now eat at least 300 million tons of marine life, three times as much as humans. There is speculation that rising numbers of <get name=\"minke\"/>s may be holding down the population of <get name=\"blue\"/>s that compete for similar food.</template></category>", "WHALE TALE", "", "<get name=\"whale\"/>s are so beloved that the authorities spent four months and $250,000 unsuccessfully trying to free a <get name=\"right\"/> dubbed Churchill from fishing ropes last year, and the stranding of 55 <get name=\"pilot\"/>s near here a few weeks ago prompted a lump in the national throat. The \"Save the <get name=\"whale\"/>s\" ethos is almost unquestioned, and <get name=\"badboys\"/> and <get name=\"badgirls\"/> risk becoming pariahs by continuing to salivate when they see a nice juicy <get name=\"whale\"/>. But it\'s time to put sentiment aside. The \"save the <get name=\"whale\"/>s\" campaign against all commercial <get name=\"whal\"/>ing was necessary a few decades ago, after <get name=\"whal\"/>ing had devastated all large species. Even today, there are fewer than 10,000 <get name=\"blue\"/>s worldwide, compared with 200,000 before they were hunted, and <get name=\"right\"/>s may become extinct. But it is equally true that restrictions on <get name=\"whal\"/>ing, including a moratorium on all commercial <get name=\"whal\"/>ing since 1986, have led to a sharp rebound in some <get name=\"whale\"/> stocks. The U.S. National <get name=\"whale\"/> Service estimated in 2000 that there are more than two million <get name=\"sperm\"/>s worldwide. The International <get name=\"whal\"/>ing Commission calculated years ago that there were more than 900,000 <get name=\"minke\"/>s and 780,000 <get name=\"pilot\"/>s worldwide, and the numbers are higher now. Milton <get name=\"whale\"/>man, a <get name=\"whal\"/>ing expert at the University of Alberta, estimates that the number of <get name=\"minke\"/>s has trebled over 30 years and that <get name=\"humpbacks\"/> are exploding at a rate of 12 to 17 percent annually. Indeed, the number of <get name=\"gray\"/>s (which came off the endangered species list in 1994) surged so much in the late 1990\'s that hundreds of dead ones began washing up on West Coast beaches, so emaciated that their ribs showed. The best guess is that the numbers of <get name=\"gray\"/> grew, the food supply shrank and Malthus had his way. The bottom line is that while most large <get name=\"whale\"/>s remain at risk, for some species we can no longer argue that we need to \"save the <get name=\"whale\"/>s.\" They\'ve been saved. At a time when there\'s talk about over<get name=\"whal\"/>ing, it\'s also worth pointing out that <get name=\"whale\"/>s now eat at least 300 million tons of marine life, three times as much as humans. There is speculation that rising numbers of <get name=\"minke\"/>s may be holding down the population of <get name=\"blue\"/>s that compete for similar food.", "", "Stories.aiml")
